import React from "react";
import CardData from "./CardData";
import MainCard from "./MainCard";

const Service = () => {
    return (
        <>

            {
                CardData.map((val, ind) => {
                    return<MainCard 
                        key = {ind}
                        title = {val.heading}
                        detail = {val.para}
                        imgSrc = {val.image}
                    />
                })
            }
        </>
    )
};

export default Service;
